(87, 'approve', 'send_rejected', 'english', 'Send Rejected', 'The {object_type} has been rejected', '<p>Hi {staff_firstname}<br /><br />Your {object_type} has been rejected.<br /><br />You can view the {object_type} on the following link <a href=\"{object_link}\">{object_name}</a><br /><br />{email_signature}</p>', '{companyname} | CRM', NULL, 0, 1, 0),
(88, 'approve', 'send_rejected', 'vietnamese', 'Gá»­i tá»« chá»‘i', '{object_type} Ä‘Ã£ bá»‹ tá»« chá»‘i', 'Xin ch&agrave;o {staff_firstname} {staff_lastname}<br /><br />{object_type} cá»§a báº¡n Ä‘Ã£ bá»‹ tá»« chá»‘i.<br /><br />Báº¡n c&oacute; thá»ƒ xem {object_type} táº¡i Ä‘&acirc;y&nbsp;<a href=\"{object_link}\">{object_name}</a><br /><br />{email_signature}', '{companyname} | CRM', NULL, 0, 1, 0),
(89, 'approve', 'send_approve', 'english', 'Send Approve', 'The {object_type} has been approved', '<p>Hi {staff_firstname}<br /><br />Your {object_type} has been approved.<br /><br />You can view the {object_type} on the following link <a href=\"{object_link}\">{object_name}</a><br /><br />{email_signature}</p>', '{companyname} | CRM', NULL, 0, 1, 0),
(90, 'approve', 'send_approve', 'vietnamese', 'Gá»­i phÃª duyá»‡t', '{object_type} Ä‘Ã£ Ä‘Æ°á»£c phÃª duyá»‡t', 'Xin ch&agrave;o {staff_firstname} {staff_lastname}<br /><br />{object_type} cá»§a báº¡n Ä‘Ã£ Ä‘Æ°á»£c phÃª duyá»‡t.<br /><br />Báº¡n c&oacute; thá»ƒ xem {object_type} táº¡i Ä‘&acirc;y&nbsp;<a href=\"{object_link}\">{object_name}</a><br /><br />{email_signature}', '{companyname} | CRM', NULL, 0, 1, 0),
