(1666, 'estimate', 'estimate-send-to-client', 'spanish', 'Send Estimate to Customer [spanish]', 'Estimate # {estimate_number} created', '<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Apreciado (a) <strong>{contact_firstname} {contact_lastname}</strong></span><br /><span style=\"font-size: 12pt;\"></span></p>\r\n<p style=\"text-align: justify;\">Me dirijo a usted en la oportunidad de remitirle adjunto a esta comunicaci&oacute;n, el Presupuesto detallado que describe los servicios legales espec&iacute;ficos que nos solicit&oacute; en su comunicaci&oacute;n anterior.</p>\r\n<p style=\"text-align: justify;\">Este Presupuesto es v&aacute;lido hasta <strong>{estimate_expirydate}</strong>. Despu&eacute;s de esta fecha, no podemos garantizar los mismos precios y condiciones. Si tiene alguna inquietud con respecto al presupuesto, no dude en contactarnos.</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Encuentre adjunta el Presupuesto con el n&uacute;mero <strong># {estimate_number}</strong></span><br /><br /><span style=\"font-size: 12pt;\"><strong>Estado del Presupuesto:</strong> {estimate_status}</span><br /><br /><span style=\"font-size: 12pt;\">Puede ver el presupuesto en el siguiente enlace: <a href=\"{estimate_link}\">{estimate_number}</a></span><br /><br /></p>\r\n<p style=\"text-align: justify;\">Quedamos a la espera de su pronta respuesta.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">Saludos cordiales,</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">{email_signature}</span></p>\r\n<p style=\"text-align: justify;\">Usted ha recibido este correo electr&oacute;nico debido a que nos proporcion&oacute; su informaci&oacute;n a alguno de nuestros asociados o eventos, autorizando su tratamiento. Usted tiene el derecho de acceder a sus datos personales que poseemos y a los detalles del tratamiento de los mismos, as&iacute; como a rectificarlos en caso de ser inexactos u oponerse al tratamiento de los mismos para fines espec&iacute;ficos, seg&uacute;n los t&eacute;rminos y condiciones establecidos por ECV &amp; Asociados en su GDPR, pol&iacute;ticas de privacidad publicadas en los siguientes enlaces {terms_and_conditions_url}{privacy_policy_url}. Si por error ha recibido este correo, o no desea seguir recibiendolos por favor comun&iacute;quese con nosotros a&nbsp;</p>', '{companyname} |  Send Estimate - Envío de Presupuesto | CRM-ECV-IP', '', 0, 1, 0),
(1667, 'ticket', 'ticket-reply-to-admin', 'spanish', 'Ticket Reply (Sent to Staff) [spanish]', 'New Support Ticket Reply', '', '{companyname} | CRM', NULL, 0, 0, 0),
(1668, 'estimate', 'estimate-already-send', 'spanish', 'Estimate Already Sent to Customer [spanish]', 'Estimate # {estimate_number} ', '<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Apreciado (a) {contact_firstname} {contact_lastname}</span></p>\r\n<p style=\"text-align: justify;\"><br /><span style=\"font-size: 12pt;\">Agradecemos la solicitud de servicios que nos han requerido.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pueden revisar nuestro presupuesto en el siguiente enlace: <a href=\"{estimate_link}\">{estimate_number}</a></span><br /><br /><span style=\"font-size: 12pt;\">No duden por favor en contactanos ante cualquier inquietud o informaci&oacute;n adicional.&nbsp;</span><br /><br /><span style=\"font-size: 12pt;\">Reciban un cordial saludo,</span><br /><span style=\"font-size: 12pt;\">{email_signature}</span></p>\r\n<p style=\"text-align: justify;\">Usted ha recibido este correo electr&oacute;nico debido a que nos proporcion&oacute; su informaci&oacute;n a alguno de nuestros asociados o eventos, autorizando su tratamiento. Usted tiene el derecho de acceder a sus datos personales que poseemos y a los detalles del tratamiento de los mismos, as&iacute; como a rectificarlos en caso de ser inexactos u oponerse al tratamiento de los mismos para fines espec&iacute;ficos, seg&uacute;n los t&eacute;rminos y condiciones establecidos por ECV &amp; Asociados en su GDPR, pol&iacute;ticas de privacidad publicadas en los siguientes enlaces {terms_and_conditions_url}{privacy_policy_url}. Si por error ha recibido este correo, o no desea seguir recibiendolos por favor comun&iacute;quese con nosotros a&nbsp;</p>', '{companyname} | Kind reminder - Amable recordatorio | CRM-ECV-IP', '', 0, 1, 0),
