(247, 'privacy_policy', '<p style=\"text-align:justify;\">La privacidad de sus datos es un asunto importante para ECV.&#160; Por esta raz&#243;n su informaci&#243;n personal es tratada con estricta confidencialidad y con arreglo a la legislaci&#243;n y pol&#237;ticas de cumplimiento m&#225;s reciente en materia de protecci&#243;n de datos. Para nosotros, la protecci&#243;n de su privacidad y de sus datos contra el acceso no autorizado por terceros, la p&#233;rdida o el uso indebido son temas prioritarios. Por consiguiente, nos reservamos el derecho a descargar/exportar sus datos contenidos en el CRM.<br><br>Usted es el &#250;nico responsable de la seguridad de su contrase&#241;a y su cuenta, y es totalmente responsable de todas las actividades que se realicen y requieran el uso de su contrase&#241;a o su cuenta, con o sin su conocimiento. Si brind&#243; su informaci&#243;n de inicio de sesi&#243;n y contrase&#241;a a otra persona, los privilegios de su cuenta pueden suspenderse temporalmente o cancelarse. Acuerda notificar inmediatamente a ECV sobre cualquier uso no autorizado de su contrase&#241;a o su cuenta, o cualquier otra violaci&#243;n de seguridad.<br><br></p>\n<p style=\"text-align:justify;\">ECV no escatimar&#225; esfuerzos para preservar la confidencialidad de sus datos. Sus datos no se ceder&#225;n ni vender&#225;n a terceros. Sin embargo, al visitar nuestro al hacer uso del sistema Perfex , usted admite que la transmisi&#243;n de datos personales a trav&#233;s de internet no est&#225; exenta de riesgo, por lo que el hecho de que nuestro sistema se encuentre respaldado en la nube Perfex impide que sea posible reclamar a ECV el da&#241;o que pueda resultar por parte de terceros no autorizados.</p>', 1),
(248, 'terms_and_conditions', '<p style=\"text-align:justify;\">Al utilizar el CRM-ECV, acepta y acuerda que ha le&#237;do todos los descargos de responsabilidad y Pol&#237;tica de privacidad, que los entiende y acepta, y que tiene la capacidad legal para estar sujeto a ellos. Estos descargos de responsabilidad y pol&#237;ticas constituyen un acuerdo legal entre usted y ECV Al utilizar el CRM-ECV, acepta y acuerda que ha le&#237;do todos los descargos de responsabilidad y pol&#237;tica de privacidad, que los entiende y acepta, y que tiene la capacidad legal para estar sujeto a ellos. Estos Descargos de responsabilidad y pol&#237;ticas constituyen un acuerdo legal entre usted y ECV<br><br>Si lo solicita, eliminaremos sus datos personales. Sin embargo, en el caso de algunos datos, la supresi&#243;n s&#243;lo tiene lugar despu&#233;s de un per&#237;odo de conservaci&#243;n determinado, por ejemplo, porque la ley especifica un per&#237;odo m&#237;nimo de conservaci&#243;n para estos datos o porque necesitamos los datos para procesar la relaci&#243;n contractual con usted.<br><br>Corregiremos o completaremos los datos personales incorrectos o incompletos si nos informa de ello.<br><br>Si lo solicita, le proporcionaremos informaci&#243;n sobre los datos personales que hemos almacenado sobre usted.</p>', 1),
